// App.js
import React from 'react';

function App() {
  return (
    <div style={{ padding: "2rem", fontFamily: "sans-serif", textAlign: "center" }}>
      <h1>Hello, World!</h1>
      <p>Welcome to the D-Fund Project</p>
    </div>
  );
}

export default App;
